-- =====================================================================================================
set names 'utf8';
-- ----------------------------------------------------------------------------------------------
create table activite(aCis SMALLINT not null,aPompier SMALLINT not null,aDateGarde DATETIME not null,aTranche TINYINT UNSIGNED not null,aDisponibilite TINYINT UNSIGNED,aGarde TINYINT(1),primary key(aCis,aPompier,aDateGarde,aTranche)) ENGINE=INNODB DEFAULT CHARSET=utf8;
-- 
create table caserne(cId SMALLINT not null,cNom VARCHAR(30),cAdresse VARCHAR(60),cTel VARCHAR(14),cGroupement VARCHAR(25),primary key(cId)) ENGINE=INNODB DEFAULT CHARSET=utf8;
-- 
create table equipe(eCis SMALLINT not null,ePompier SMALLINT not null,eIntervention INT not null,primary key(eCis,ePompier,eIntervention)) ENGINE=INNODB DEFAULT CHARSET=utf8;
-- 
-- create table garde(gCis SMALLINT not null,gDate DATETIME not null,gTranche TINYINT UNSIGNED not null,gNbPompiers SMALLINT,primary key(gCis,gDate,gTranche)) ENGINE=INNODB DEFAULT CHARSET=utf8;
-- 
create table intervention(iCis SMALLINT not null,iId INT not null,iLieu VARCHAR(60),iDescription VARCHAR(60),iDate DATETIME,iTranche TINYINT UNSIGNED,iHeureDebut DATETIME,iHeureFin DATETIME,iType SMALLINT,iNbPompiers SMALLINT,primary key(iCis,iId)) ENGINE=INNODB DEFAULT CHARSET=utf8;
-- 
create table parametre(pType VARCHAR(7) not null,pIndice SMALLINT not null,pLibelle VARCHAR(80),pValeur VARCHAR(20),pPlancher DOUBLE,pPlafond DOUBLE,primary key(pType,pIndice)) ENGINE=INNODB DEFAULT CHARSET=utf8;
-- 
create table pompier(pCis SMALLINT not null,pId SMALLINT not null,pNom VARCHAR(40),pPrenom VARCHAR(40),pStatut SMALLINT,pType SMALLINT,pMail VARCHAR(33),pLogin VARCHAR(10),pMdp VARCHAR(35),pAdresse VARCHAR(25),pCp VARCHAR(5),pVille VARCHAR(25),pBip VARCHAR(10),pNbGardes SMALLINT,pGrade SMALLINT,pCommentaire VARCHAR(200),pDateEnreg DATETIME,pDateModif DATETIME,primary key(pCis,pId)) ENGINE=INNODB DEFAULT CHARSET=utf8;
-- 
create table typeParametre(tpId VARCHAR(7) not null,tpLibelle VARCHAR(70),tpBooleen TINYINT(1),tpChoixMultiple TINYINT(1),primary key(tpId)) ENGINE=INNODB DEFAULT CHARSET=utf8;
